"original": |2-
     This specification establishes the Warn-codes sub-registry under
     http://www.iana.org/assignments/sip-parameters and initiates its
     population with the warn-codes listed in Section 20.43.  Additional
     warn-codes are registered by RFC publication.
"fixed": |-
  This specification establishes the Warn-codes sub-registry under http://www.iana.org/assignments/sip-parameters and initiates its population with the warn-codes listed in Section 20.43.  Additional warn-codes are registered by RFC publication.
"ko": |-
  이 사양은 http://www.iana.org/locationments/sip-parameters 아래에 Warn-codes 하위 레지스트리를 설정하고 섹션 20.43에 나열된 경고 코드로 채우기를 시작합니다. 추가 경고 코드는 RFC 간행물에 의해 등록됩니다.
